INSERT INTO `coursecategory` VALUES (1,'REDHAT LINUX','REDHAT LINUX Course Details ','Hi Greetings From Radical Technologies!!!\r\n\r\nFollowing writings will give you clear Idea About  the Technologies, Certifications Related And Syllabus of\r\n\r\nRedhat Linux And Related Technologies\r\nVirtualization - VMWARE VCP 505+ 6.0\r\nCloud Computing - AWS | Openstack | Windows Azure\r\nHigh Availability : Veritas Cluster + Volume Manager\r\nCisco UCS - Implementation and Configurations\r\n\r\nNote:- Any Further Queries After going through the below documents,we Recommend You to Attend The Free Demo On Weekends . You can Attend Any Demo Lectures Free Of Cost .If you need Separate Counselling , Take Prior Appointment for Weekends\r\n\r\nBenefits of Learning and Upskilling to IT Infrastructure Services Technologies\r\n\r\nOne of the biggest advantage with IT IMS ( IT Infrastructure Management )service profiles is that the life cycles are always more than a year and clients generally do not change service providers unless there are major cost benefits. There are very rare chances to have recession in this area of expertise.\r\nNo high qualifications of the resources for these services and non-graduates can be employed if they are properly trained and Certified\r\nThe job profile does not require high creative and analytical skills as required from software developers. Techies in these roles can expect to work without much work pressure . If you are in Software Development Team, Delivery date nearing , Complete the coding before deadline all these increase your work pressure and nature of work.\r\nThere is quite a lot room to grow in this type of services - As Storage Expert , As Cloud Expert , as Virtualisation Expert etc\r\nIT IMS Technologies can provide employment to a huge number of IT Engineers who do not like coding.\r\n\r\n\r\nRadical Technologies Provide Wide Variety of courses in IT Infrastructure Management\r\n\r\nI ]  Redhat Linux RHEL 6.0 + RHEL 7.0 Combo course \r\n\r\nAbove Course Consists of  Three Parts SA1 + SA2 + SA3\r\n\r\nRedHat Linux Syllabus :-  &#8203;&#8203;REDHAT LINUX RHEL 6.0 + 7.0 COMBO \r\n\r\nRedhat Linux is a flavour Of UNIX Operating system . As per the current Market situation , Redhat Linux and Other Linux variants leading in the Market compared to Legacy UNIX operating system Like AIX , HP-Ux , Oracle solaris etc due to Hardware Dependency cost\r\n\r\nRedhat Linux and all Other variants Linux can be installed on X86 Architecture And compatible with Virtual environment Setup , Which will reduce the cost on IT Infrastructure of the companies\r\n\r\nOnce You learn one Operating system , Next step You can think about Any Virtualization tool . And 70% of the Virtualization market is captured by VMWARE ESXi . ESXi a UNIX Based Virtual Operating system.\r\n\r\nPrerequisite : No Prerequisite\r\n\r\nDuration : 120 Hrs Total Including Complete Lab Practicals\r\nTrainer : Consultant Having 15+ Y Experience\r\nAvailability : Weekend and Weekdays\r\nNext Available Demo / Batch : \r\nExam Preparation : RHCSA + RHCE - Sure Shot Exam Preparation Included\r\nLAB Setup : 20 i3 Machines with 16GB Memory | Cisco UCS 5108 Chase Loaded with 6 blades Having 64GB Memory and 24Core CPU Each .\r\n\r\n2 ] VMWARE Syllabus : VMWARE VCP 5.5 + 6.0 COMBO\r\n\r\nVMWARE With Linux OS is More demanding Technology Skill in the Market , Because most of the production servers are running on Linux and ESXi itself is a UNIX based Virtual Operating system . \r\n\r\nREDHAT Virtualization & HyperV Virtualization Tool : Both of these Virtualization Technologies are also having a little presence in the industry . \r\n\r\nPrerequisite : Windows Or Linux system Admin\r\n\r\nDuration : 50 Hrs Total Including Complete Lab Practicals\r\nTrainer : Architect / Consultant Having 12+ Y Experience\r\nAvailability : Weekend and Weekdays\r\nNext Available Demo / Batch : \r\nExam Preparation : VMWARE VCP 6.0 Sure Shot Exam Preparation Included\r\nLAB Setup : Consists of Bare Metal ESXi On \r\n1)Cisco UCS 5108 Chase Loaded with 6 blades Having 64GB RAM and 24Core CPU Each . \r\n2) HP Workstation With 96 GB RAM and Dual CPU\r\n\r\n\r\n3 ] Enterprise Server Administration Cisco UCS Syllabus : Adv CISCO UCS\r\n\r\nThis technology is for Experienced system Admins having 3+ years of experience  in IMS filed . Irrespective of Windows or UNIX flavour , everyone can learn this Hardware Based Server Administration Course . It has separate hardware console , through which it manages every Physical and Virtual Machines . Radical Technologies , is the First Training Institute in Pune who introduced Real Cisco UCS Hardware and Training in Affordable Price with High Quality technical deliverables . Will cover Migration , Implementation and Firmware Upgradation with Cisco UCS Administration course.\r\n\r\nPrerequisite : Windows or Linux system Admin\r\n\r\nDuration : 32 Hrs Total Including Complete Lab Practicals\r\nTrainer : Architect / Consultant Having 12+ Y Experience\r\nAvailability : Weekend and Weekdays\r\nNext Available Demo / Batch : \r\nExam Preparation : Cisco UCS Exam Preparation Included\r\nLAB Setup :Cisco UCS 5108 Chase Loaded with 6 blades Having 64GB RAM and 24Core CPU Each \r\n\r\n4 ] Red Hat Openstak : Redhat Openstack Syllabus\r\n\r\nLatest Technology Trend in IaaS Cloud . Private Cloud , Made of Linux Flavour . Since this is open source and organisations can set up their private cloud using their own infrastructure and technical skills , most of the companies are moving Openstack to manage their internal Infrastructure in very secure cloud . It can span across the geographical locations \r\n\r\nPrerequisite to Learn Openstack : Good Understanding of Linux Operating system and Knowledge on Any Virtualization tool\r\n\r\nDuration : 60 Hrs of Complete Lab Practicals\r\nTrainer : Consultant Having 15+ Y Experience\r\nAvailability : Weekend and Weekdays\r\nNext Available Demo / Batch : \r\nExam Preparation : RHCSA CLOUD CL110 + CL210- Sure Shot Exam Preparation Included\r\nLAB Setup : 20 i3 Machines with 16GB Memory | Cisco UCS 5108 Chase Loaded with 6 blades Having 64GB Memory and 24Core CPU Each .\r\n\r\n\r\nOther Redhat Technologies Track\r\n\r\nNot recommended until and unless , if its organisation requirements for their customers to get trained and certified. Below courses are recommended for those who want to Up-skill themself and move towards Redhat Certified System Architect .\r\n\r\nRED HAT ENTERPRISE VIRTUALIZATION \r\nREDHAT CLUSTER\r\nOPENSHIFT ENTERPRISE ADMINISTRATION\r\nRED HAT SATELLITE SERVER\r\n\r\nWINDOWS AZURE And AWS :- Public Cloud\r\n\r\nBoth of them are Public Cloud and widely used in the Industry . As per the current market scenario , AWS Cloud is having more customers compared to any other Public cloud vendors . We would recommend both the Azure and AWS for System Admins , Architects , Consultant , Presales consultant etc .\r\n\r\nPrerequisite : Freshers to Experience person can take this course . Even Though No Prerequisite is required for this course , better to have Windows or Linux OS Knowledge  . We will start from the Very Basic and go through the advanced course. \r\n\r\n5] Windows Azure Syllabus : WINDOWS AZURE\r\n\r\nDuration : 40 Hrs of Complete Lab Practicals on Cloud\r\nTrainer : Architect / Consultant Having 15+ Y Experience\r\nAvailability : Weekend and Weekdays Classes\r\nNext Available Demo / Batch : \r\nExam Preparation : Exam 70-533: Implementing Microsoft Azure Infrastructure Solutions Sure Shot Exam Preparation Included\r\n\r\n\r\n6 ] AWS Syllabus: AWS - Certified Solution Architect \r\n\r\nDuration : 40 Hrs of Complete Lab Practicals on Cloud\r\nTrainer : Architect / Consultant Having 15+ Y Experience\r\nAvailability : Weekend and Weekdays Classes\r\nNext Available Demo / Batch : \r\nExam Preparation : AWS - Certified Solution Architect  Sure Shot Exam Preparation Included\r\n\r\n7 ] VERITAS CLUSTER And VOLUME MANAGER : VERITAS CLUSTER   + VXVM\r\n\r\n\r\nAs an Experienced  System Admin, You should know one High Availability Technology .If you want to upskill to a different level in your career , Then VCS + VXVM is must . Most of the interviews, they ask Veritas Cluster and Volume Manager related questions . Recommended for 3+ year Experienced System admins .\r\n\r\nSince VCS can be installed on multi vendor operating systems , And it has developed different installation packages for different operating systems .Installation methods are different . But Commands in all UNIX and Linux Flavours are almost same. Mostly , it It will be installed on Linux and Solaris Systems .\r\n\r\n\r\nDuration : 40 Hrs of Complete Lab Practicals\r\nTrainer : Architect / Consultant Having 10+ Y Experience\r\nAvailability : Weekend  Classes\r\nNext Available Demo / Batch : \r\nExam Preparation : VCS and VXVM  Sure Shot Exam Preparation Included .\r\n\r\n\r\n\r\nWhy Radical Technologies  : Experience Our Expertise Our Features At Glance For the Above Courses ,  :-\r\n\r\n1 ] We do have 2000 + Live scenarios for IMS Related Technologies\r\n2 ] 100% delivery of All Practicals\r\n3 ] Assignments On Every weekends\r\n4 ] Trainers are well Experienced Ranging from  7 to 20 Years .\r\n6 ] Attend the batch until you are comfortable for next 6 months without Any extra fee\r\n7 ] Installation On Your Laptop\r\n8 ] 100 % quality assurance in training .Complete Support And Guidance After The Course - Will Return the Money if Any Such Complaint of Trainers      Not supporting After the Completion of the Course validating the same with Trainer And Student . \r\n9 ] No Limitation to Number of Interview Calls\r\n10] Any Career Gaps will be taken care by Injecting Technology and Upskill You to 4+ Year Of Experienced Candidate.\r\n11] 5000+ Placement Records and 80+  Tie up with MNC?s and Consultancies\r\n12 ] 25000+ Man-Hours of Real-time projects & scenarios including All Technologies\r\n13 ] 10000+ Total Practical Scenarios including All Technologies ,Pool of 150 + Corporate Trainers\r\n14 ] Job Oriented scenarios that will make you perfect to start your career at any new organisation you Joined\r\n15 ] Resume Preparation, Mock interviews, and Placement assistance with 100 percent genuine effort from our side to place you in the industry . \r\n16] Best hardware set-up LAB Sun, IBM, HP Workstations, VMWARE , CISCO UCS Servers\r\n\r\nEXAM Delivery @ Radical Technologies\r\n\r\nRadical Technologies is authorized Test Center of Kryterion since 2015 . Authorized to conduct exams for Amazon Web Service , Salesforce , ServiceNow, Informatica and Many more\r\nwww.webassessor.com through which you can book all Kryterion delivered exams.\r\n\r\nRadical Technologies is Authorized Test center of  Pearson Vue since 2014. PearsonVue have 100+ vendors as part of their test delivery system . Candidates can take exam of vendors like Oracle , IBM , Microsoft , HP VMware ,EMC , Netapp and other world class top universities.\r\nhttps://home.pearsonvue.com/test-taker.aspx\r\n\r\nRadical Technologies is an Authorized Redhat training partner since 2012 . We have conducted 500+ exams with 99% passing in first attempt . Our defined curriculum will help our students to appear for exam with full confidence.120 students scored 300/300 in their RHCSA and RHCE exams.We started delivering RHEL 7 Exams for System Administrator and Cloud Platform. From 2015 onwards, we started conducting Redhat Openstack Cloud RHCSA and RHCE  exams .Our training curriculum will help not only to pass the exams , But also help you to get real time industry experience scenarios from industry experts.All our Trainers are having 10+ years of experience in respective field.\r\n\r\n\r\nThanks & Regards,\r\nTom | 7620576832\r\nTraining Department\r\n\r\nRadical Technologies | Office No : 102,1st Floor | Stellar Enclave\r\nAbove Mc Donalds | Opp Reliance  Mart | DP Road | Aundh |Pune 411007\r\n020 65006548|+91 8446422731|+91 9552573917 | +91 9168255512\r\nwww.radicaltechnologies.co.in | training@radicaltechnologies.co.in','2017-03-16 16:02:22'),(2,'UNIX',NULL,NULL,NULL),(3,'DATA WAREHOUSING | BI',NULL,NULL,NULL),(4,'DATABASE',NULL,NULL,NULL),(5,'ORACLE EBS',NULL,NULL,NULL),(6,'VIRTUALIZATION',NULL,NULL,NULL),(7,'CLOUD COMPUTING',NULL,NULL,NULL),(8,'BIGDATA & HADOOP',NULL,NULL,NULL),(9,'MIDDLEWARE',NULL,NULL,NULL),(10,'PROGRAMMING LANGUAGES',NULL,NULL,NULL),(11,'SOFTWARE TESTING',NULL,NULL,NULL),(12,'STORAGE',NULL,NULL,NULL),(13,'NETBACKUP',NULL,NULL,NULL),(14,'MICROSOFT LYNC SERVER 2013',NULL,NULL,NULL),(15,'CISCO','Test Subject','Mail body','2017-03-16 15:49:49'),(16,'SHELL | PERL | PYTHON SCRIPTING',NULL,NULL,NULL),(17,'WINDOWS',NULL,NULL,NULL),(18,'HIGH AVAILABILITY',NULL,NULL,NULL),(19,'CAD/CAM/CAE',NULL,NULL,NULL),(20,'WEB DEVELOPMENT',NULL,NULL,NULL),(21,'MANAGEMENT',NULL,NULL,NULL);
